import React, {Component} from 'react';
import './Button.css';

class Button extends Component {
    render() {
        const { type, text } = this.props;
        let className = 'light';
        if (type === 'dark') {
            className = 'dark';
        }

        return (
            <button className={className}>
                {text}
            </button>
        )
    }
}

export default Button;
